import React from 'react';
import sdata from './Sdata';
import Card from './Card';
import Namefield from './Namefield';

function Ncard (val){
    return (<>
    <Namefield/>
    <Card 
        key={val.id} 
            src={val.src}
            title={val.title}
            details={val.details}
            link={val.link}
        />
        </>);
}
const App = () => {
    return(<>
    
{sdata.map(Ncard)}
    </>);
}

export default App;
